script: |
  super -f text -I q11040.spq | sort > q11040.out

inputs:
  - name: q11040.spq
    data: |
      SELECT ALL - - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( - - col2, + 16 + + CAST ( NULL AS INTEGER ) - col2 / - col2, 57 + - col2 * + - col2, 70 * + ( - col2 ), + - col1 );
  - name: tab1

outputs:
  - name: q11040.out
    data: |
